                <i class="fa fa-regular fa-heart"></i>
              </button>
              <button type="button" class="btn btn-dark">
                <i class="fa fa-thumbs-down"></i>
              </button>
            </div>
          </div>
        </div>
        ;
      </div>
    </>
  );
}
export default App;
